import React from "react";

const RentalInfo = ({ rental }) => {
  const { subtitle } = rental;
  return (
    <div className="RentalInfos">
      <h2>{rental.subtitle}</h2>
      <p>
        {rental.guests} {rental.guests === 1 ? "guest" : "guests"} •{" "}
        {rental.bedrooms} {rental.bedrooms === 1 ? "bedrooms" : "bedroom"} •{" "}
        {rental.beds} beds •{rental.bath} bathrooms
      </p>
    </div>
  );
};

export default RentalInfo;
